//pages/Nav.js
import React from "react";
import './headerMain.css';
import { Link } from "react-router-dom";
function headerMain() {
  return (
        <div className = "HeadLine">
            <div id = "Logo">#강원여행</div>
            <Link to = "/eventAndFestival"><div id = "weatherCast">여행 예보</div></Link>
            <div id = "search"></div>
            <div id = "logIn">LOGIN</div>
            <div id = "myPage"></div>
        </div>
    

    
  );
}

export default headerMain;


